# app.R — Matrix Lab (worked steps, CSS fraction, Run buttons in 2nd row, NULL-safe scalars)
if (requireNamespace("webr", quietly = TRUE)) {
  webr::install(c("shiny", "bslib"))
}

library(shiny)
library(bslib)

LIGHT_BLUE <- "#767da2"
ORANGE     <- "#cd6118"

base_font_val <- "Lexend, system-ui, -apple-system, Segoe UI, Roboto, Helvetica, Arial, sans-serif"
code_font_val <- "Recursive, ui-monospace, SFMono-Regular, Menlo, Consolas, 'Liberation Mono', monospace"

dark_theme <- bs_theme(
  version   = 5,
  bg        = "#1d1f2b",
  fg        = "#e1e2ea",
  primary   = ORANGE,
  secondary = "#5a5f80",
  base_font = base_font_val,
  code_font = code_font_val
)

css_rules <- paste(
