  ".shiny-input-container { margin-bottom: 10px; }",
  ".container-fluid{ max-width: 1100px; padding-top: 16px; padding-top: calc(16px + env(safe-area-inset-top)); }",
  "@media (max-width: 700px){ .container-fluid{ padding-left:12px; padding-right:12px; } }",
  "h2.title { font-size: 20px; line-height: 1.25; margin: 6px 0 10px; font-weight: 600; }",
  "@media (max-width: 576px) { h2.title { font-size: 18px; } }",

  ".no-stack { display: flex; gap: 16px; align-items: stretch; }",
  ".no-stack .left, .no-stack .right { flex: 1 1 0; min-width: 0; }",
  "@media (max-width: 700px) { .no-stack { flex-direction: column; } }",

  ".cardish { background: var(--bs-body-bg); border: 1.5px solid #5a5f80; border-radius: .6rem; padding: 12px; }",

  sprintf(".form-control, .form-select, .selectize-input{ background-color:%s !important; color:var(--bs-body-color)!important; border:1px solid %s!important; box-shadow:none!important; }", LIGHT_BLUE, LIGHT_BLUE),
  sprintf(".form-control:focus, .form-select:focus, .selectize-input.focus{ border-color:%s!important; box-shadow:0 0 0 .15rem rgba(205,97,24,.35)!important; }", ORANGE),

  ".slider-narrow .irs { max-width: 260px; }",
  ".irs--shiny .irs-line, .irs--shiny .irs-bar, .irs--shiny .irs-bar-edge { height: 6px; }",

  #/* Toolbar: row1 Op|Scalar|(spacer); row2 Run|Clear|Random */
    ".toolbar-grid{ 
     display:grid; 
     grid-template-columns: 1fr 180px 170px; 
     grid-template-rows: auto auto; 
     grid-template-areas: 'op scalar .' 'run clear rand';
     gap:10px; align-items:end; 
  }",
  ".toolbar-grid .slot-op{ grid-area: op; }",
  ".toolbar-grid .slot-scalar{ grid-area: scalar; }",
  ".toolbar-grid .slot-run{ grid-area: run; }",
  ".toolbar-grid .slot-clear{ grid-area: clear; }",
  ".toolbar-grid .slot-rand{ grid-area: rand; }",
  ".toolbar-grid .form-select, .toolbar-grid .form-control, .toolbar-grid .btn{ height:44px; }",
  ".toolbar-grid .form-select, .toolbar-grid .form-control{ width:100%; }",
  ".btn{ white-space:nowrap; }",
  ".btn-primary{ background-color:#e57726!important; border-color:#e57726!important; color:#000!important; font-weight:600; }",
  ".btn-ghost{ background:transparent!important; border:1px solid #5a5f80!important; color:#e1e2ea!important; }",
  "@media (max-width: 1000px){ .toolbar-grid{ grid-template-columns: 1fr 160px 150px; } }",
  "@media (max-width: 700px){ 
    .toolbar-grid{ grid-template-columns: 1fr; grid-template-areas: 'op' 'scalar' 'run' 'clear' 'rand'; } 
  }",

  #/* Matrix visuals */
    ".matrix-wrap{ display:flex; justify-content:center; }",
  ".matrix-box{ position:relative; display:inline-block; padding:6px 10px; }",
  ".matrix-box:before, .matrix-box:after{ content:''; position:absolute; top:0; bottom:0; width:6px; border:2px solid var(--bs-body-color); opacity:.35; }",
  ".matrix-box:before{ left:-8px; border-right:none; border-radius:6px 0 0 6px; }",
  ".matrix-box:after{ right:-8px; border-left:none; border-radius:0 6px 6px 0; }",
