  ".matrix td{ min-width:56px; text-align:right; padding:2px 6px; background:transparent; border:none; border-radius:0; font-variant-numeric: tabular-nums; }",
  ".matrix.expr td{ min-width:auto; text-align:left; padding:2px 6px; font-size:1rem; background:transparent; border:none; }",
  ".matrix { border-collapse: separate; border-spacing: 4px; }",
  ".matrix td{ min-width:48px; }",

  ".eqline{ display:flex; flex-wrap:wrap; align-items:center; gap:12px; justify-content:center; }",
  ".op{ font-size:20px; font-weight:600; opacity:.9; }",
  ".scalar { font-size: 1.05rem; padding: 2px 0; text-align:center; }",

  ".steps { font-size: 15px; line-height: 1.45; }",

  #/* CSS fraction (no MathJax needed) */
    ".frac{ display:inline-flex; flex-direction:column; align-items:center; line-height:1; }",
  ".frac .num{ font-size:0.95em; }",
  ".frac .den{ border-top:2px solid currentColor; padding-top:2px; margin-top:2px; font-size:0.95em; }",
  sep = "\n"
)
dark_theme <- bs_add_rules(dark_theme, css_rules)

# ---------- helpers ----------
matrixInputTable <- function(id_prefix, nrow, ncol, label = NULL, width = "80px") {
  rows <- lapply(seq_len(nrow), function(i) {
    tags$tr(
      lapply(seq_len(ncol), function(j) {
        inputId <- paste(id_prefix, i, j, sep = "_")
        tags$td(textInput(inputId, label = NULL, value = "0", width = width))
      })
    )
  })
  tagList(
    if (!is.null(label)) tags$h5(label),
    tags$table(
      class = "table table-sm table-bordered align-middle",
      style = "width:auto;",
      tags$tbody(rows)
    )
  )
}

readMatrix <- function(input, id_prefix, nrow, ncol) {
  m <- matrix(0, nrow, ncol)
  for (i in seq_len(nrow)) for (j in seq_len(ncol)) {
    key <- paste(id_prefix, i, j, sep = "_")
    val <- suppressWarnings(as.numeric(input[[key]]))
    if (is.na(val)) val <- NA_real_
    m[i, j] <- val
  }
  m
}

# number formatting
fmt_num <- function(x, digits = 3, paren_neg = FALSE) {
  if (!is.finite(x)) return("NA")
  s <- formatC(x, digits = digits, format = "f")
  if (paren_neg && x < 0) paste0("(", s, ")") else s
}

# expression matrices
expr_elementwise <- function(A, B, op = "+", digits = 3) {
  stopifnot(all(dim(A) == dim(B)))
  M <- matrix("", nrow(A), ncol(A))
  sym <- if (op == "+") " + " else " − "
  for (i in seq_len(nrow(A))) for (j in seq_len(ncol(A))) {
    M[i, j] <- paste0(fmt_num(A[i, j], digits, TRUE), sym, fmt_num(B[i, j], digits, TRUE))
  }
  M
}
expr_mul <- function(A, B, digits = 3, max_terms = 6) {
  p <- ncol(A); stopifnot(p == nrow(B))
  out <- matrix("", nrow(A), ncol(B))
  for (i in seq_len(nrow(A))) for (j in seq_len(ncol(B))) {
    if (p <= max_terms) {
      terms <- vapply(seq_len(p), function(k) {
        paste0(fmt_num(A[i,k], digits, TRUE), "⋅", fmt_num(B[k,j], digits, TRUE))
      }, character(1))
      out[i, j] <- paste(terms, collapse = " + ")
    } else {
      out[i, j] <- paste0("∑ a[", i, ",k]⋅b[k,", j, "]  (k = 1…", p, ")")
    }
  }
  out
}
expr_scale <- function(s, A, digits = 3) {
  M <- matrix("", nrow(A), ncol(A))
  s_txt <- fmt_num(s, digits, TRUE)
  for (i in seq_len(nrow(A))) for (j in seq_len(ncol(A))) {
    M[i, j] <- paste0(s_txt, "×", fmt_num(A[i, j], digits, TRUE))
  }
  M
}

det_explain <- function(A, digits = 3) {
  n <- nrow(A); m <- ncol(A)
  if (n != m) return(NULL)
  if (n == 2) {
    a <- A[1,1]; b <- A[1,2]; c <- A[2,1]; d <- A[2,2]
    paste0(
      "det(A) = a·d − b·c = ",
      fmt_num(a, digits, TRUE), "⋅", fmt_num(d, digits, TRUE),
      " − ", fmt_num(b, digits, TRUE), "⋅", fmt_num(c, digits, TRUE)
    )
  } else if (n == 3) {
    a11 <- A[1,1]; a12 <- A[1,2]; a13 <- A[1,3]
    a21 <- A[2,1]; a22 <- A[2,2]; a23 <- A[2,3]
    a31 <- A[3,1]; a32 <- A[3,2]; a33 <- A[3,3]
    pos <- paste(
      paste0(fmt_num(a11,digits,TRUE),"⋅",fmt_num(a22,digits,TRUE),"⋅",fmt_num(a33,digits,TRUE)),
      paste0(fmt_num(a12,digits,TRUE),"⋅",fmt_num(a23,digits,TRUE),"⋅",fmt_num(a31,digits,TRUE)),
      paste0(fmt_num(a13,digits,TRUE),"⋅",fmt_num(a21,digits,TRUE),"⋅",fmt_num(a32,digits,TRUE)),
      sep = " + "
    )
    neg <- paste(
      paste0(fmt_num(a13,digits,TRUE),"⋅",fmt_num(a22,digits,TRUE),"⋅",fmt_num(a31,digits,TRUE)),
      paste0(fmt_num(a12,digits,TRUE),"⋅",fmt_num(a21,digits,TRUE),"⋅",fmt_num(a33,digits,TRUE)),
      paste0(fmt_num(a11,digits,TRUE),"⋅",fmt_num(a23,digits,TRUE),"⋅",fmt_num(a32,digits,TRUE)),
      sep = " + "
    )
    paste0("det(A) = (", pos, ") − (", neg, ")")
  } else {
    "det(A) computed numerically (n>3)."
  }
}

# renderers
matrixBox <- function(M, digits = 3) {
  is_expr <- !is.numeric(M)
  fmt_cell <- function(x) if (is_expr) as.character(x) else fmt_num(x, digits, FALSE)
  tags$div(
    class = "matrix-box",
    tags$table(
      class = if (is_expr) "matrix expr" else "matrix",
      tags$tbody(lapply(seq_len(nrow(M)), function(i) {
        tags$tr(lapply(seq_len(ncol(M)), function(j) tags$td(fmt_cell(M[i, j]))))
      }))
    )
  )
}
matrixEq <- function(..., digits = 3) {
  parts <- list(...)
  nodes <- lapply(parts, function(p) {
    if (inherits(p, "shiny.tag") || inherits(p, "shiny.tag.list")) {
      p
    } else if (is.character(p) && length(p) == 1) {
      tags$span(class = "op", p)
    } else if (is.matrix(p)) {
      matrixBox(p, digits)
    } else {
      tags$span(class = "op", as.character(p))
    }
  })
  tags$div(class = "eqline", nodes)
}
renderMatrixTable <- function(M, digits = 3) tags$div(class = "matrix-wrap", matrixBox(M, digits))
safe_inverse <- function(M) tryCatch(list(success=TRUE, value=solve(M)), error=function(e) list(success=FALSE, value=conditionMessage(e)))

# NEW: inline HTML fraction (no MathJax)
frac_tag <- function(num_text, den_text) {
  tags$span(
    class = "frac",
    tags$span(class = "num", num_text),
    tags$span(class = "den", den_text)
  )
}

