# ---------- server ----------
server <- function(input, output, session) {
  # keep Run in 2nd row regardless of scalar visibility
  output$scalarA_ui <- renderUI({
    if (identical(input$unaryA, "scaleA")) {
      numericInput("scalarA", "Scalar s (for s×A)", value = 1, step = 0.5, width = "100%")
    } else {
      tags$div()
    }
  })
  output$scalarB_ui <- renderUI({
    if (identical(input$unaryB, "scaleB")) {
      numericInput("scalarB", "Scalar s (for s×B)", value = 1, step = 0.5, width = "100%")
    } else {
      tags$div()
    }
  })

  output$A_inputs <- renderUI({ matrixInputTable("A", input$A_nrow, input$A_ncol) })
  output$B_inputs <- renderUI({ matrixInputTable("B", input$B_nrow, input$B_ncol) })

  clear_result <- function(){
    output$result_table <- renderUI(NULL)
    output$scalar_result <- renderUI(NULL)
    output$steps <- renderUI(NULL)
    output$error_msg <- renderUI(NULL)
  }
  set_error <- function(msg){
    output$result_table <- renderUI(NULL)
    output$scalar_result <- renderUI(NULL)
    output$steps <- renderUI(NULL)
    output$error_msg <- renderUI(tags$div(class="text-danger", msg))
  }
  fill_matrix_inputs <- function(prefix, M){
    updateSliderInput(session, paste0(prefix,"_nrow"), value = nrow(M))
    updateSliderInput(session, paste0(prefix,"_ncol"), value = ncol(M))
    session$onFlushed(function(){
      for(i in seq_len(nrow(M))) for(j in seq_len(ncol(M))){
        updateTextInput(session, paste(prefix,i,j,sep="_"), value = as.character(M[i,j]))
      }
    }, once = TRUE)
  }

  observeEvent(input$clearA, { fill_matrix_inputs("A", matrix(0, input$A_nrow, input$A_ncol)); clear_result() })
  observeEvent(input$clearB, { fill_matrix_inputs("B", matrix(0, input$B_nrow, input$B_ncol)); clear_result() })
  observeEvent(input$randA,  { fill_matrix_inputs("A", matrix(sample(-9:9, input$A_nrow*input$A_ncol, TRUE), input$A_nrow)); clear_result() })
  observeEvent(input$randB,  { fill_matrix_inputs("B", matrix(sample(-9:9, input$B_nrow*input$B_ncol, TRUE), input$B_nrow)); clear_result() })

  renderMatrixTableSafe <- function(M, d) renderMatrixTable(M, digits = d)

  # NULL-safe scalar reads
  get_scalarA <- function(op) {
    if (!identical(op, "scaleA")) return(1)
    if (is.null(input$scalarA)) return(1)
    s <- suppressWarnings(as.numeric(input$scalarA))
    if (length(s) != 1 || !is.finite(s)) 1 else s
  }
  get_scalarB <- function(op) {
    if (!identical(op, "scaleB")) return(1)
    if (is.null(input$scalarB)) return(1)
    s <- suppressWarnings(as.numeric(input$scalarB))
    if (length(s) != 1 || !is.finite(s)) 1 else s
  }

  # ----- A panel -----
  observeEvent(input$runA, {
    clear_result()
    A <- readMatrix(input, "A", input$A_nrow, input$A_ncol)
    if (any(is.na(A))) { set_error("Matrix A has non-numeric/empty cells."); return() }
    op <- input$unaryA; s <- get_scalarA(op); d <- input$digits

    if (op == "tA") {
      R <- t(A)
      output$result_table <- renderUI(renderMatrixTableSafe(R, d))
      output$steps <- renderUI(matrixEq(A, "→", R, digits = d))

    } else if (op == "invA") {
      if (nrow(A) != ncol(A)) { set_error("inv(A) requires A to be square."); return() }
      if (nrow(A) == 2) {
        a <- A[1,1]; b <- A[1,2]; c <- A[2,1]; d2 <- A[2,2]
        detA <- a*d2 - b*c
        if (!is.finite(detA) || abs(detA) < .Machine$double.eps) { set_error("A not invertible (det(A) = 0)."); return() }
        Adj <- matrix(c(d2, -b, -c, a), 2, 2, byrow = TRUE)
        R   <- (1/detA) * Adj

        den <- paste0(fmt_num(a,d,TRUE),"⋅",fmt_num(d2,d,TRUE)," − ",fmt_num(b,d,TRUE),"⋅",fmt_num(c,d,TRUE))
        frac_lbl <- frac_tag("1", den)
        output$result_table <- renderUI(renderMatrixTable(R, d))
        output$steps <- renderUI(matrixEq(A, "⁻¹ =", frac_lbl, "×", Adj, "=", R, digits = d))
      } else {
        invA <- safe_inverse(A)
        if (!invA$success) { set_error(paste0("A not invertible: ", invA$value)); return() }
        I <- diag(nrow(A))
        output$result_table <- renderUI(renderMatrixTable(invA$value, d))
        output$steps <- renderUI(matrixEq(A, "×", invA$value, "=", I, digits = d))
      }

    } else if (op == "detA") {
      if (nrow(A)!=ncol(A)) { set_error("det(A) requires A to be square."); return() }
      value <- det(A)
      explain <- det_explain(A, d)
      output$scalar_result <- renderUI(tags$div(class="scalar", HTML(sprintf("<b>Scalar:</b> det(A) = %s", formatC(value, digits=d, format="f")))))
      output$steps <- renderUI(tagList(
        if (!is.null(explain)) tags$div(class="eqline", tags$span(class="op", explain)) else NULL,
        matrixEq(A, digits = d)
      ))

    } else if (op == "scaleA") {
      R <- s * A
      output$result_table <- renderUI(renderMatrixTableSafe(R, d))
      output$steps <- renderUI(matrixEq(A, "→", expr_scale(s, A, d), "=", R, digits = d))
    }
  })

  # ----- B panel -----
  observeEvent(input$runB, {
    clear_result()
    B <- readMatrix(input, "B", input$B_nrow, input$B_ncol)
    if (any(is.na(B))) { set_error("Matrix B has non-numeric/empty cells."); return() }
    op <- input$unaryB; s <- get_scalarB(op); d <- input$digits

    if (op == "tB") {
      R <- t(B)
      output$result_table <- renderUI(renderMatrixTableSafe(R, d))
      output$steps <- renderUI(matrixEq(B, "→", R, digits = d))

    } else if (op == "invB") {
      if (nrow(B) != ncol(B)) { set_error("inv(B) requires B to be square."); return() }
      if (nrow(B) == 2) {
        a <- B[1,1]; b <- B[1,2]; c <- B[2,1]; d2 <- B[2,2]
        detB <- a*d2 - b*c
        if (!is.finite(detB) || abs(detB) < .Machine$double.eps) { set_error("B not invertible (det(B) = 0)."); return() }
        Adj <- matrix(c(d2, -b, -c, a), 2, 2, byrow = TRUE)
        R   <- (1/detB) * Adj

        den <- paste0(fmt_num(a,d,TRUE),"⋅",fmt_num(d2,d,TRUE)," − ",fmt_num(b,d,TRUE),"⋅",fmt_num(c,d,TRUE))
        frac_lbl <- frac_tag("1", den)
        output$result_table <- renderUI(renderMatrixTable(R, d))
        output$steps <- renderUI(matrixEq(B, "⁻¹ =", frac_lbl, "×", Adj, "=", R, digits = d))
      } else {
        invB <- safe_inverse(B)
        if (!invB$success) { set_error(paste0("B not invertible: ", invB$value)); return() }
        I <- diag(nrow(B))
        output$result_table <- renderUI(renderMatrixTable(invB$value, d))
        output$steps <- renderUI(matrixEq(B, "×", invB$value, "=", I, digits = d))
      }

    } else if (op == "detB") {
      if (nrow(B)!=ncol(B)) { set_error("det(B) requires B to be square."); return() }
      value <- det(B)
      explain <- det_explain(B, d)
      output$scalar_result <- renderUI(tags$div(class="scalar", HTML(sprintf("<b>Scalar:</b> det(B) = %s", formatC(value, digits=d, format="f")))))
      output$steps <- renderUI(tagList(
        if (!is.null(explain)) tags$div(class="eqline", tags$span(class="op", explain)) else NULL,
        matrixEq(B, digits = d)
      ))

    } else if (op == "scaleB") {
      R <- s * B
      output$result_table <- renderUI(renderMatrixTableSafe(R, d))
      output$steps <- renderUI(matrixEq(B, "→", expr_scale(s, B, d), "=", R, digits = d))
    }
  })

  # ----- Binary operations -----
  observeEvent(input$runBinary, {
    clear_result()
    A <- readMatrix(input, "A", input$A_nrow, input$A_ncol)
    B <- readMatrix(input, "B", input$B_nrow, input$B_ncol)
    if (any(is.na(A)) || any(is.na(B))) { set_error("Please enter numeric values in A and B."); return() }
    op <- input$binaryOp; d <- input$digits

    if (op %in% c("add","sub")) {
      if (!all(dim(A)==dim(B))) { set_error("A and B must have the same dimensions for A±B."); return() }
      R <- if (op=="add") A + B else A - B
      exprM <- expr_elementwise(A, B, op = if (op=="add") "+" else "-", digits = d)
      output$result_table <- renderUI(renderMatrixTableSafe(R, d))
      output$steps <- renderUI(matrixEq(A, if (op=="add") "+" else "−", B, "=", exprM, "=", R, digits = d))
      return()
    }

    if (op == "mulAB") {
      if (ncol(A)!=nrow(B)) { set_error("For A×B, ncol(A) must equal nrow(B)."); return() }
      R <- A %*% B
      exprM <- expr_mul(A, B, d)
      output$result_table <- renderUI(renderMatrixTableSafe(R, d))
      output$steps <- renderUI(matrixEq(A, "×", B, "=", exprM, "=", R, digits = d))
      return()
    }

    if (op == "mulBA") {
      if (ncol(B)!=nrow(A)) { set_error("For B×A, ncol(B) must equal nrow(A)."); return() }
      R <- B %*% A
      exprM <- expr_mul(B, A, d)
      output$result_table <- renderUI(renderMatrixTableSafe(R, d))
      output$steps <- renderUI(matrixEq(B, "×", A, "=", exprM, "=", R, digits = d))
      return()
    }

    if (op == "rdiv") { # A × B⁻¹
      if (nrow(B)!=ncol(B)) { set_error("A ÷ B uses B⁻¹; B must be square."); return() }
      if (ncol(A)!=nrow(B)) { set_error("A ÷ B requires ncol(A) = nrow(B)."); return() }
      invB <- safe_inverse(B); if (!invB$success) { set_error(paste0("B not invertible: ", invB$value)); return() }
      R <- A %*% invB$value
      exprM <- expr_mul(A, invB$value, d)
      output$result_table <- renderUI(renderMatrixTableSafe(R, d))
      output$steps <- renderUI(tagList(
        matrixEq(B, "→", invB$value, digits = d),
        matrixEq(A, "×", invB$value, "=", exprM, "=", R, digits = d)
      ))
      return()
    }

    if (op == "ldiv") { # A⁻¹ × B
      if (nrow(A)!=ncol(A)) { set_error("A \\ B uses A⁻¹; A must be square."); return() }
      if (nrow(A)!=nrow(B)) { set_error("A \\ B requires nrow(A) = nrow(B)."); return() }
      invA <- safe_inverse(A); if (!invA$success) { set_error(paste0("A not invertible: ", invA$value)); return() }
      R <- invA$value %*% B
      exprM <- expr_mul(invA$value, B, d)
      output$result_table <- renderUI(renderMatrixTableSafe(R, d))
      output$steps <- renderUI(tagList(
        matrixEq(A, "→", invA$value, digits = d),
        matrixEq(invA$value, "×", B, "=", exprM, "=", R, digits = d)
      ))
      return()
    }
  })
}

